syntax = "proto2";
import "modules/msgs/basic_msgs/header.proto";
import "oem7_header.proto";

message IMURATECORRIMU {
  optional apollo.common.Header header = 1;
  optional Oem7Header nov_header = 2;
  optional uint32 week = 3;
  optional double seconds = 4;
  optional double pitch_rate = 5;
  optional double roll_rate = 6;
  optional double yaw_rate = 7;
  optional double lateral_acc = 8;
  optional double longitudinal_acc = 9;
  optional double vertical_acc = 10;
}
